import React from 'react';

const PinControls = (props) => {
  return (
    <div className="pin-controls">
      <a href={`/maps/${props.canvasId}/pins/new`}>
        <button alt="add"><i className="material-icons" onClick={(event)=>props.togglePinInput(event)}>add_circle</i></button>
      </a>
      <button alt="filter"><i className="material-icons" onClick={event=>props.toggleColorFilter(event)}>filter_list</i></button>
    </div>
  )
}

export default PinControls;
